import React, { useState, useEffect } from 'react';

function App() {
  const [stockData, setStockData] = useState([]);
  const [stockDataKeys, setStockDataKeys] = useState([]);
  console.log(stockDataKeys)

  useEffect(() => {
    fetch('/api/stock-data')
      .then(response => response.json())
      .then(data => {

        let dkey = Object.keys(data);
        setStockData(data);
        setStockDataKeys(dkey);


      });


  }, []);

  return (
    <div>


      {


        stockData.map((data, index) => (
        <div key={index}>
          {/* <p>Date = {data.date}</p>
          <p>Open = {data.open}</p>
          <p>High = {data.high}</p>
          <p>Low = {data.low}</p>
          <p>Close = {data.close}</p>
          <p>Volume = {data.volume}</p>
          <hr/> */}
        </div>
      ))}
    </div>
  );
}

export default App;
